css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("menshealth.com")

{

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, p, form, footer, #page, #footerbox, .more_news, .news_feed_container, #footer_ctr

{
color: white !important;
background: black !important;
border: black !important;
}

.footer_links a, .footer_links a:hover, .footer_links a:active, .footer_links a:link, .footer_links a:visited, #footer_ctr .copyrt

{
background: black !important;
}

/*links*/

a

{
color: #0040ff !important;
}

/*highlight*/

textarea, pre

{
background: #333333 !important;
}

}
